import styled from "styled-components";

const SearchResultsStyles = styled.div`
  .results {
    display: grid;
    grid-template-columns: repeat(3, 200px);
  }

  .results-item:nth-last-child(2) {
    grid-column-start: 2;
  }

  .results-item {
    display: flex;
    max-height: 220px;

    &__image {
      display: flex;
    }
  }
`;
export default SearchResultsStyles;
